import styles from './AboutCompany.module.css';
import imageLogo from '../../Assets/logo.png';

function AboutCompany() {
    return(
        <div>
            <div className={styles.logo}>
                <img src={imageLogo} alt="logo" />
                <span>OT-Groupe</span>
            </div>
        </div>
    )
}

export default AboutCompany;
